import Avatar from "../profile/Avatar/avatar";
import React, {FC, ReactElement, useState} from 'react';
import {IDataCounter} from "./iterfaces/IDataCounter";
import "./style.sass"
import axios from "axios";

interface Entity {
    name: string;
    count: string;
}
export const DataCounter: FC<IDataCounter> = (props): ReactElement => {

    const [data, setData] = useState<Entity[]>([]);

    const getRoles = async () => {
        const response = await axios.get("http://localhost:3300/entitiesCount");
        if(response.status === 200){
            setData(response.data);
            console.log(response.data);
        }
    }
  return (
    <>
        {data &&
            Object.entries(data).map(([key, value], index) => (
          <div key={index} className={"counter-container"}>
            <Avatar  name={value.count}/>
            <h3>
                {value.name}
            </h3>
          </div>
        ))}

    </>
  );
};
